import React, { useEffect, useState } from 'react';
import { query } from '../utils/api';

const Home = ({ user }) => {
  const [data, setData] = useState({ hits: [] });
  useEffect(() => {
    async function fetchData() {
      const response = await query(
        {
          collection: 'newsbg',
          limit: 1,
          descending: false,
          fields: ['title', 'image', 'vreme'],
        },
        'eyJraWQiOiJiZGRadUdBZE1QREl0RlwvRk9JTmlOdG9SQ3Z1R1Y3WitBYURkSjh2RDJ5cz0iLCJhbGciOiJSUzI1NiJ9..RoQxpZdAQJZnb9z5S-M-PhW5-xwayRTYJwC8Vk5GueaewbnqocVNb7gp-DpbdGrBz77nM3G56YSICFK6FxXoZf8ncxHG7qCL8bJmdS88jMbtfHj2WA4EaFdpBUuxIlN3IpCPkE04F0yJFrg0MeGMs9ykWM5-ByJn_WSWuCql1lzR_XVSrrZxSAy4xA23ntoE7h0Yc3Gn4x55qbfIJlzxvwKt_6HIgiU2-kjpgWQ5nb_NmhSaaN4RqvZor2Wl0a3ysONDw-TS0GGN7p3y-Vhzjj2wCXBdfLJ0WI7OflRg6WjNT2Rq3tzD9uVkCPX5VoQUvIWW1CBGt83s5lcVAS3cEQ',
      );

      setData(response.data);
    }
    fetchData();
  }, []);
  return (
    <div>
      <h1>Начало</h1>

      {JSON.stringify(data)}
    </div>
  );
};

export default Home;
